import React from "react"
import TodoList from "./TodoList.json"
export function Item(props) {
    return (
        <li>
            <h3>
                * {props.title}, {props.weekday} {props.month} {props.day} {props.year}
            </h3>
        </li>
    )
}

function ToDo() {
    return (
        <div>
            <ul>
                {TodoList.map(todo => {
                    return <Item
                        title={todo.title}
                        weekday={todo.weekday}
                        month={todo.month}
                        day={todo.day}
                        year={todo.year}
                        key={todo.id} />
                })}
            </ul>
        </div>
    )
};

export default ToDo
